import './App.css';
import "bootstrap/dist/css/bootstrap.min.css"
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import ControlledCarousel from './components/Carousel';

function App() {
  return (
    <>
      <Navbar />
      <ControlledCarousel />
      <Footer />
    </>
  );
}

export default App;
